import React from 'react';

function About() {
  return (
    <section id="about">
      <h2>À propos de moi</h2>
      <p>Je suis un développeur spécialisé en IA, traitement des données, et solutions modernes en logiciel.</p>
      <p>Compétences principales : Python, Java, microservices, deep learning.</p>
    </section>
  );
}

export default About;
